import "@fortawesome/fontawesome-free/css/all.min.css";

export default function HomePage() {
  return (
    <div>
      <header>
        <div>
          <h1>OUR SIGNATURE</h1>
        </div>
        <div>
          <a>
            <i className="fas fa-user"></i>
          </a>
          <a>
            <i className="fas fa-shopping-cart"></i>
          </a>
        </div>
      </header>
    </div>
  );
}
